import React from 'react';
import {
    Card,
    CardBody,
    CardTitle,
    CardSubtitle,
    CardText,
    CardFooter,
    Button,
    Container
} from 'reactstrap';

const Admin=({admin})=>{
    return(
        <Card className="text-center">
            <CardBody>
                <CardSubtitle className="font-weight-bold">Admin</CardSubtitle>
                <CardText>Name : {admin.fName} {admin.lName}</CardText>
                <CardText>Gender: {admin.gender}</CardText>
                <CardText>Email: {admin.email}</CardText>
                <CardText>Phone No: {admin.phoneNo}</CardText>
            <Container className="text-center">
                <Button color="danger">Delete</Button>
                <Button color="warning ml-4">Update</Button>
            </Container>
            </CardBody>
        </Card>
    )
}
export default Admin;
